import Skeleton, {SkeletonTheme} from 'react-loading-skeleton'



export function SkeletonComponent(){

return (
    <SkeletonTheme highlightColor="#444">
       <Skeleton 
            height={1000} 
            width={240} 
            count={1} 
            style={{
              position: 'fixed',
              left:0,
              top:0
            }}
        baseColor='#000'/>
  </SkeletonTheme> 
)
}

